import React, {useState} from "react";
import HeaderText from "../HeaderText";
import Img from '../../SourceFiles/Main/HomeImage1.jpg'
import FlexBox from "../FlexBox";

function OurLastestWork() {
  const [Data, setData] = useState([
      {
          id : 1,
          img : 'Img'
      },
      {
        id : 2,
        img : 'Img'
    },
    {
        id : 3,
        img : 'Img'
    },
    {
        id : 4,
        img : 'img'
    },
    {
        id : 5,
        img : 'Img'
    },
    {
        id : 6,
        img : 'Img'
    },
    {
        id : 7,
        img : 'Img'
    },
    {
        id : 8,
        img : 'Img'
    }
  ]);
  return (
    <section id="our-lastest-work">
      <div id="our-lastest-work-container">
        <HeaderText
          name="Our Lastest Works"
          text="Lorem ipsum dolor sit amet. Proin gravida nibh vel velit auctor
            aliquet"
        />
        <div id = 'our-last-works-item'>
            {Data.forEach(item => {
                return(
                    <FlexBox img={item.id}/>
                )
            })}
        </div>
      </div>
    </section>
  );
}

export default OurLastestWork;
